import React from 'react';
import {Box, Grid} from "@material-ui/core";

import {useStyles} from "./style";
import SignUp from "./SIgnUp";
import SignIn from "./SignIn";
const SignForms = () => {
    const classes = useStyles()
    return (
        <Grid>
            <Box>
                <SignIn />
            </Box>
            <Box>
                <SignUp />
            </Box>
        </Grid>
    );
};

export default SignForms;
